import { Col, Container, Row, Table } from "react-bootstrap";

const Fixtures = () => {
  return (
    <Container fluid>
      <Row>
        <Col md={6}>
          <span>League</span>
          <div className="d-flex justify-content-between">
            <div>
              <span>Louis</span>
              <span>Louis</span>
            </div>
            <div>
              <span>Mar 5</span>
              <span>15:00</span>
            </div>
          </div>
        </Col>
      </Row>
    </Container>
  );
};
export default Fixtures;
